import React from 'react';

function UserInitializer({ onInitialize }) {
  return (
    <div className="user-initializer">
      <p className="user">User 1</p>
      <p className="user">User 2</p>
      <p className="user">User 3</p>
    </div>
  );
}

export default UserInitializer;
